import React from 'react';
import CategoryBar from "./CategoryBar";
import BrandBar from "./BrandBar";

const Filters = () => {
    return (
        <div className="mt-1">
            <p>Filters:</p>
            <CategoryBar/>
            <BrandBar/>
        </div>
    );
};

export default Filters;
